def react(polymer):
    reacted = False
    i = 0

    while True:
        if (polymer[i] != polymer[i + 1]) and (polymer[i].upper() == polymer[i+1] or polymer[i] == polymer[i+1].upper()):
            # print(polymer[i] +' ' + polymer[i+1])
            polymer.pop(i)
            polymer.pop(i)

            reacted=True
        i += 1
        if i > len(polymer) - 2:
            if reacted:
                i = 0
                reacted = False
            else:
                return ''.join(polymer)



